    u"""Od 24. ledna 2008 je zahájen příjem žádostí u programu přeshraniční spolupráce Cíl 3 Česká republika - Svobodný stát Bavorsko 2007-2013.""",
    u"""Řídící orgán Programu (Ministerstvo pro místní rozvoj ČR) zahajuje "Operační program přeshraniční spolupráce Česká republika - Polská republika 2007-2013". Příjem žádostí je průběžný a začíná 14. ledna 2008. Pro projednání na Monitorovacím výboru v červnu 2008 se budou žádosti přijímat do 14. března 2008, do 14:00 hodin.""",
    u"""V rámci Operačního programu Přeshraniční spolupráce Česká republika - Polská republika 2007—2013 mohou vedoucí partneři z jelenigórsko-walbrzyského podregionu předkládat své projektové žádosti do 28. února 2008 na pracovišti v Liberci.""",
    u"""Uzávěrka "druhého kola" přijímání žádostí o finanční příspěvek je dne 30. 9. 2008. Žádosti je možné zasílat poštou nebo donést osobně na STS resp. Infobod do 14:00 hodin.""",
    u"""Dne 31.7.2008 byl vyhlášen Program Cíl 3 Evropská územní spolupráce: Přeshraniční spolupráce Česká republika - Svobodný stát Sasko.""",
    u"""Po schválení operačního programu přeshraniční spolupráce ČR-Rakousko 2007—2013 na konci prosince roku 2007, se v současné době pracuje na další navazující dokumentaci, která bude po odsouhlasení partnery zveřejněna na těchto stránkách.""",
    u"""Dne 1. února 2008 proběhl ustavující Monitorovací výbor programu Přeshraniční spolupráce Česká republika-Rakousko 2007—2013. Na tomto zasedání byl domluven další harmonogram prací.""",
    u"""Program přeshraniční spolupráce Česká-republika-Rakousko 2007—2013 se realizuje pomocí kontinuální výzvy. To znamená že po vyhlášení programu, které se uskutečnilo 27. března 2008, je možno kdykoliv přeložit Vaši projektovou žádost na příslušný regionální subjekt (krajský úřad v ČR, úřad zemské vlády v Rakousku) nebo na Společný technický sekretariát v Brně nebo ve Vídni.""",
    u"""Sdružení obcí a měst jižní Moravy ve spolupráci s Regionální rozvojovou agenturou jižní Moravy vyhlašuje výzvu na předkládání projektových žádostí do FMP v Jihomoravském kraji.""",
    u"""Sdružení Jihočeská Silva Nortica vyhlašuje dne 18. 6. 2008 Fond malých projektů programu Cíl 3, Evropská územní spolupráce, Rakousko-ČR 2007-2013 pro Jihočeský kraj.""",
    u"""Příští zasedání Monitorovací výboru se uskuteční 12. a 13. května 2009. Proto poslední termín pro předložení projektových žádostí je 27.2.2009. Projektové žádosti, které budou odevzdány do tohoto data a budou úplné a v pořádku (projdou kontrolou formálních náležitostí a kontrolou přijatelnosti), se budou projednávat na tomto Monitorovacím výboru.""",
    u"""Sdružení obcí a měst jižní Moravy, správce Fondu malých projektů (FMP) v Jihomoravském kraji, ve spolupráci s Regionální rozvojovou agenturou jižní Moravy pro Vás připravilo další kolo sběru projektových žádostí. Neváhejte a předložte svůj projekt do FMP. Tento fond podporuje projekty přeshraniční spolupráce s Rakouskem, jejichž celkové náklady nepřekročí 40.000 EUR . Termín podání žádostí: do 19.3.2009 do 16:00 hodin""",
    u"""Globálním cílem oblasti podpory 1.2 je zvýšení adaptability zaměstnanců ohrožených nezaměstnaností a zaměstnavatelů restrukturalizovaných podniků. Specifické cíle jsou zabezpečení požadované kvalifikační struktury zaměstnanců v restrukturalizovaných organizacích pro jejich pracovní mobilitu jak ve vlastní organizaci, tak pro trh práce; zvýšená péče zaměstnancům, kteří se z věkových a zdravotních důvodů obtížněji uplatňují na trhu práce; nové pracovní uplatnění a příprava na nová pracovní místa, včetně poradenství, rekvalifikace a odborné praxe.""",
    u"""Cílem podpory výzvy č. 30 je sociální začleňování sociálně vyloučených osob a osob ohrožených sociálním vyloučením, včetně odstraňování bariér v jejich přístupu k zaměstnání.""",
    u"""Globálním cílem výzvy č. 34 je zvýšení úrovně odborných znalostí, dovedností a kompetencí zaměstnanců a zaměstnavatelů. Specifické cíle jsou rozvoj podnikových systémů řízení lidských zdrojů a rozvoje lidských zdrojů s využitím inovativních přístupů, rozvoj kvalifikační úrovně a kompetencí zaměstnanců, motivace zaměstnavatelů k prosazování odborného vzdělávání v rámci organizace, posílení udržitelnosti pracovních míst.""",
    u"""Hlavním cílem podpory je přispět ke zvyšování adaptability zaměstnanců podniků v profesních oborových a odvětvových sdruženích prostřednictvím podpory dalšího profesního vzdělávání těchto zaměstnanců.""",
    u"""Globální a specifické cíle oblasti podpory jsou posilování institucionální kapacity a efektivnosti výkonu státní správy, zvýšit kvalitu regulace, zefektivnit vzdělávání a rozvoj úředníků správních úřadů, zlepšit kvalitu řízení a managementu ve správních úřadech a zvýšit transparentnost a otevřenost správních úřadů.""",
    u"""Pro Ministerstvo vnitra ČR – Kabinet ministra vnitra; Kancelář náměstka ministra vnitra pro veřejnou správu, informatiku, legislativu a archivnictví; Odbor reformy regulace a kvality veřejné správy; Odbor legislativy a koordinace předpisů; Odbor rozvoje lidských zdrojů ve veřejné správě; Oddělení Institutu státní správy.""",
    u"""Sociální začleňování příslušníků sociálně vyloučených romských komunit, zajištění dostupnosti, kvality a kontroly služeb, včetně odstraňování bariér v jejich přístupu ke vzdělávání a k zaměstnání a v přístupu k investiční podpoře.""",
    u"""Cíle: • Přímá podpora příslušníků sociálně vyloučených romských komunit, kterým je omezen přístup ke službám a na trh práce. • Podpora zajištění dostupnosti a kvality sociálních služeb směřujících k integraci příslušníků sociálně vyloučených romských komunit, včetně podpory v přístupu k investiční podpoře. • Podpora oblasti prevence sociálního vyloučení a oblasti prevence kriminality. • Podpora systémových aktivit systému sociálních služeb pro příslušníky sociálně vyloučených romských komunit, především ve vztahu k zákonu o sociálních službách, souvisejícím právním normám a k transformaci sociálních služeb, včetně podpory evaluace efektivnosti služeb. • Posílení kapacity a řízení subjektů a organizací poskytujících nebo podporujících poskytování služeb směřujících k integraci příslušníků sociálně vyloučených romských komunit, včetně podpory partnerství na místní a regionální úrovni.""",
    u"""Globálním cílem této oblasti podpory je přispět ke zintenzivnění mezinárodní spolupráce v oblasti rozvoje lidských zdrojů a zaměstnanosti. Specifické cíle jsou zvýšit efektivnost strategií a politik v oblasti lidských zdrojů a zaměstnanosti a rozvoj partnerství, paktů a iniciativ v oblasti lidských zdrojů a zaměstnanosti.""",
    u"""Cíle: • Realizace nástrojů aktivní politiky zaměstnanosti. • Zvýšení efektivnosti využití nástrojů aktivní politiky zaměstnanosti a zavádění nových či inovovaných nástrojů. • Podpora zprostředkovatelských aktivit a vytváření nových pracovních míst či podpora pracovních míst vyčleněných na trhu práce pro konkrétní osobu.""",
    u"""Globálním cílem této oblasti podpory je prosazování cílených opatření pro plnění principu rovných příležitostí žen a mužů na trhu práce a vytváření podmínek pro soulad pracovního a rodinného života.""",
    u"""Cíl: Zvýšení kapacity, komplexnosti a kvality služeb poskytovaných institucemi zaměstnanosti.""",
    u"""Hlavním cílem podpory je přispět ke zvyšování adaptability zaměstnanců a konkurenceschopnosti podniků s důrazem na rozvoj sociálního dialogu a budování kapacit sociálních partnerů. Tyto aktivity povedou k naplnění globálního cíle oblasti podpory 1.1, kterým je zvýšení úrovně odborných znalostí, dovedností a kompetencí zaměstnanců a zaměstnavatelů.""",
