    u"""Cílem výzvy je sociální začleňování sociálně vyloučených osob a osob ohrožených sociálním vyloučením, včetně odstraňování bariér v jejich přístupu ke vzdělávání a k zaměstnání, cestou zajištění a zvyšování dostupnosti, kvality a kontroly služeb.""",
    u"""Operační program Central Europe – program Evropské Unie, který podporuje kooperaci mezi členskými státy v regionu Střední Evropa (Rakousko, Česká republika, Německo, Maďarsko, Itálie, Polsko, Slovensko, Slovinsko) – uskutečnil další krok k implementaci projektů, které mají zásadní důležitost pro tuto oblast. Od 12.července do 17.září 2010 jsou veřejné a soukromé organizace vyzývány představit svůj „Experssion of Interest - Vyjádření zájmu o účast v projektech“ a přidat se k pozdějšímu partnerství v těchto projektech.""",
    u"""Cílem výzvy je sociální začleňování sociálně vyloučených osob a osob ohrožených sociálním vyloučením, včetně odstraňování bariér v jejich přístupu ke vzdělávání a k zaměstnání, cestou zajištění a zvyšování dostupnosti, kvality a kontroly služeb.""",
