    u"Od 1. 3. 2012 jsme uzavřeli se svým zaměstnancem dohodu o pracovní činnosti na přípravu součástek pro montáž. Tuto práci bude vykonávat doma. V dohodě o pracovní činnosti nebyl pracovní úvazek ani příjem sjednán. Bude odměňován, podle množství připravených součástek. Tuto práci pro nás vykonával již v loňském roce a jeho příjem za tento rok činil celkem 140 000 Kč. Nevíme, jak tohoto zaměstnance posoudit, nejsme si jisti, zda jde o zaměstnání malého rozsahu. Kdy ho máme přihlásit k pojištění.",
    u"Jsme zemědělský podnik. Při sezónních pracích nám vypomáhají bývalí zaměstnanci - poživatelé starobního důchodu. Uzavíráme s nimi na dobu od 1. 1. do 31. 3. dohodu o provedení práce a na dobu od 1. 4. do 30. 11. dohodu o, pracovní činnosti na poloviční pracovní úvazek (tj. 20 hodin týdně) s hodinovou mzdou 100 Kč. Máme za tyto zaměstnance odvádět pojistné na sociální zabezpečení?",
    u"Náš zaměstnanec ošetřoval nemocné dítě a předal nám rozhodnutí o potřebě ošetřování. Máme vyplácet náhradu mzdy nebo doklady rovnou zaslat na OSSZ?",
    u"Zaměstnankyně je dočasně práce neschopná od 6. 5. (v tento den nepracovala), lékař jí vystavil průkaz o trvání pracovní neschopnosti místo ke 21. dni až k 22. dni trvání pracovní neschopnosti (tj. k 20. 5.). Mám tento průkaz o, trvání pracovní neschopnosti spolu s dalšími doklady předávat OSSZ pro výplatu nemocenského? Pokud ano, na základě jakého dokladu vyplatím náhradu mzdy za prvních 21 kalendářních dnů dočasné pracovní neschopnosti?",
    u"Zaměstnanec byl uznán dočasně práce neschopným od 26. 1., dočasná pracovní neschopnost pokračuje po celý únor a dále. Pracovní dny 26. 1. až 28. 1. nejsou placené, sobota a neděle nejsou pracovní dny, placené jsou pracovní dny, mezi 31. 1. a 15. 2. Kolik dnů mezi 26. 1. a 15. 2. (a které to jsou) se započítává do vyloučené doby pro následné nemocenské dávky?",
